  \"the-tule-elk-habitat-use-and-patterns-of-movement-at-san-luis-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In 1972, eighteen tule elk were transferred
  to an enclosure on the San Luis National Wildlife Refuge. Since that time, relatively
  little biological data has been collected on these animals. Hence, the purpose of
  this study to gather general information on the elk and habitat within the enclosure.
  Beginning July 6, 1981, through September 18, 1981, the tule elk were observed to
  determine habitat use and patterns of movement throughout the enclosure.\",\n\t\"license_title\":
